import React from 'react';
import { Grid, Typography } from '@material-ui/core';

 const Home = () => {
  return (
    <div>
      <Grid item xs={12}>
        <Typography align='center'>Call For Help</Typography>
      </Grid>
    </div>
  )
}

export default Home
